import React from 'react';
import {Link} from 'react-router-dom';
const Nav = _ => {
  return (
    <nav>
      <h3>logo</h3>
      <Link to="/coming-soon">
        <span>Coming Soon</span>
      </Link>
      <Link to="/favorites">
        <span>Favorites</span>
      </Link>
    </nav>
  )
}

export default Nav;
